export const infinity: f64 = Number.MAX_VALUE;
export const pi: f64 = 3.1415926535897932385;
export const delta: f64 = 0.000001;

@inline
export function degrees_to_radians(degrees: f64): f64{
    return degrees * pi / 180.0;
}

@inline
export function random_double(): f64{
    return Math.random();
}

@inline
export function random_double_range(min: f64, max: f64): f64{
    if(Math.abs(max - min) < delta){
        return min;
    }
    return min + (max - min) * random_double();
}

@inline
export function clamp(x: f64, min: f64, max: f64): f64{
    if(x < min){ return min; }
    if(x > max){ return max; }
    return x;
}

@inline
export function random_int(min: i32, max: i32): i32 {
    return <i32>(random_double_range(<f32>min, <f32>(max + 1)));
}

@inline
export function random_cosine_direction(): vec3 {
    const r1 = random_double();
    const r2 = random_double();
    const z = Math.sqrt(1 - r2);

    const phi = 2 * pi * r1;
    const x = Math.cos(phi) * Math.sqrt(r2);
    const y = Math.sin(phi) * Math.sqrt(r2);

    return new vec3(x, y, z);
}

